import React from "react";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import TableHead from "@mui/material/TableHead";
import TableBody from "@mui/material/TableBody";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";
import TableSortLabel from "@mui/material/TableSortLabel";
import IconButton from "@mui/material/IconButton";
import SearchIcon from "@mui/icons-material/Search";
import GetAppIcon from "@mui/icons-material/GetApp";
import InfoIcon from '@mui/icons-material/Info';
import Tooltip from '@mui/material/Tooltip';

function StreamerTable({ streamers, orderBy, order, searchTerm, handleRequestSort, downloadCSV, formatNumberWithCommas }) {
  return (
    <TableContainer>
      <Table sx={{ minWidth: 750 }} aria-labelledby="tableTitle" size="medium">
        <TableHead>
          <TableRow>
            <TableCell>
              <TableSortLabel
                active={orderBy === "username"}
                direction={orderBy === "username" ? order : "asc"}
                onClick={() => handleRequestSort("username")}
              >
                Username
              </TableSortLabel>
            </TableCell>
            <TableCell>
              <TableSortLabel
                active={orderBy === "averageViewers"}
                direction={orderBy === "averageViewers" ? order : "asc"}
                onClick={() => handleRequestSort("averageViewers")}
              >
                Average Viewers
              </TableSortLabel>
            </TableCell>
            <TableCell>
              <TableSortLabel
                active={orderBy === "peakViewers"}
                direction={orderBy === "peakViewers" ? order : "asc"}
                onClick={() => handleRequestSort("peakViewers")}
              >
                Peak Viewers
              </TableSortLabel>
            </TableCell>
            <TableCell>
              <TableSortLabel
                active={orderBy === "hoursWatched"}
                direction={orderBy === "hoursWatched" ? order : "asc"}
                onClick={() => handleRequestSort("hoursWatched")}
              >
                Hours Watched
              </TableSortLabel>
            </TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {streamers.map((streamer) => (
            <TableRow key={streamer._id}>
              <TableCell>{streamer.username}</TableCell>
              <TableCell>
                {formatNumberWithCommas(streamer.averageViewers)}
              </TableCell>
              <TableCell>
                {formatNumberWithCommas(streamer.peakViewers)}
              </TableCell>
              <TableCell>
                {formatNumberWithCommas(streamer.hoursWatched)}
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default StreamerTable;
